function SplitTransformValue(transformVal){
	var translate='translate(';
	var firstIndex=transformVal.indexOf(translate);
	var secondIndex=transformVal.indexOf(')');
	var splitInTwo;
	if(firstIndex > -1){
		splitInTwo=transformVal.substring(firstIndex+translate.length,secondIndex)
		var parts = splitInTwo.split(',');
		return parts;
	}
	return null;
}
