function resizeChart(chart, div) {  
  var svg = $(div).children('svg');
  if (!svg.is(':visible')) {
    return;
  }

  var parentDiv = svg.parents('.ssc-responsive-block');
  if (parentDiv.length == 0) {
    return;
  }

  var parentTd = svg.parents('td');
  var maxWidth = parentTd.width();           
  var ratio, newWidth = $(div).data('sourceWidth'), newHeight = $(div).data('sourceHeight'); 

  if(newWidth > maxWidth){
    newWidth = maxWidth;
  } 

  chart.resize({ height: newHeight, width: newWidth - 30 });
};
function calculateChartWidth(div, width, height ){
  var ratio, newWidth = width, newHeight = height;  
  if (div.data('sourceWidth') == null) {
      div.data('sourceWidth', width);
  }
  var block = div.parents('.ssc-responsive-block');
  if(block.length == 0) return width;

  var parentTd = div.parents('td');
  var maxWidth = parentTd.width();
   if(newWidth > maxWidth){
      newWidth = maxWidth;
    } 
    return newWidth - 30;
}
function calculateChartHeight(div, width, height ){
  var ratio, newWidth = width, newHeight = height;  
   if (div.data('sourceHeight') == null) {
      div.data('sourceHeight', height);
  }
  var block = div.parents('.ssc-responsive-block');
  if(block.length == 0) return height;
  return newHeight;
}
